import React, {Fragment} from 'react'
import './Home.css'
import img from './me.jpg'

class Home extends React.Component {
    render() {
        return (
            <body class='page'>
                <div>
                    <img class="me" src={img} height="300em" alt='Ryley'></img>
                </div>
                <div class="about" ></div>                <div class="about" >
                    <p >Hi, I'm Ryley Liston. I'm a nerd and a metal head and enjoy most things related to computers and games. I currently live in utah county with my wife, Karin, and my dog, Ellie. if you are interested in seeing some of my work click <a class="inline" href="Projects.html">here</a>. if you are interested in contacting me click <a class="inline" href="Contact.html">here</a>. if you are interested in my music tastes click <a class="inline" href="https://open.spotify.com/user/12142222125?si=ZhFDbIIjQ-W0SDUiH8siBQ"> here </a> </p>
                </div>
                </body>
        )
    }

} export default Home
